// App.js
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import LandingPage from './pages/LandingPage';
import Login from './pages/Login';

const App = () => {
  return (
    <div>
      <BrowserRouter path >
        <Routes>
          <Route index element ={<LandingPage />}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;
